  false,\n\t\"url\": null,\n\t\"notes\": \"The map layer of Color-Sliced Elevation
  of the Conterminous United States is a 100-meter resolution elevation image of the
  United States, in an Albers Equal-Area Conic projection. Each color tint represents
  a range of elevation values. There are 32 elevation classes and colors required
  to map all 50 of the United States, Puerto Rico, and the U.S. Virgin Islands, plus
  an additional class and color to represent non-U.S. land. The conterminous United
  States map layer contains elevation classes 1 to 31, as well as class 33 (non-U.S.
  land). The color-sliced elevation data were derived from National Elevation Dataset
  (NED) data and show the terrain of the conterminous United States at a resolution
  of 100 meters. The NED is a raster product assembled by the U.S. Geological Survey,
  designed to provide national elevation data in a seamless form with a consistent
  datum, elevation unit, and projection. Data corrections made in the NED assembly
  process minimize artifacts, permit edge matching, and fill sliver areas of missing
  data. More information on NED can be found at http://ned.usgs.gov.\",\n\t\"license_title\":
